import React from "react";
import { Navbar, Button } from "flowbite-react";

const Navigation = () => {
    return (
        <div>
            <Navbar className="container mx-auto" fluid={true} rounded={true}>
                <Navbar.Brand href="https://flowbite.com/">
                    <img src="https://flowbite.com/docs/images/logo.svg" className="mr-3 h-6 sm:h-9" alt="Flowbite Logo" />
                    <span className="self-center whitespace-nowrap text-xl font-semibold dark:text-white">Flowbite</span>
                </Navbar.Brand>
                <div className="flex md:order-2">
                    {/* <Button>Get started</Button> */}
                    <button className="bg-primary text-quaternary py-2 px-4 text-sm font-semibold rounded-md">Login</button>
                    <Navbar.Toggle />
                </div>
                <Navbar.Collapse>
                    <Navbar.Link href="/" active={true}>
                        Home
                    </Navbar.Link>
                    <Navbar.Link href="/job-vacancy">Job Vacancy</Navbar.Link>
                </Navbar.Collapse>
            </Navbar>
        </div>
    );
};

export default Navigation;
